var backends_touchtype_meta_texts = [{
  "value": "HTML5 后台不支持触摸事件。因此，它无法在平板电脑和移动设备上运行。您可以使用 react-dnd-touch-backend 来处理触摸设备。",
  "paraId": 0,
  "tocIndex": 0
}, {
  "value": "npm install react-dnd-touch-backend\n",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "import { TouchBackend } from 'react-dnd-touch-backend'\nimport { DndProvider } from 'react-dnd'\n\nclass YourApp {\n  <DndProvider backend={TouchBackend} options={opts}>\n    {/* Your application */}\n  </DndProvider>\n}\n",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "enableTouchEvents(default: true)：指示是否启用触摸事件处理的标志。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "enableMouseEvents(default: false)：表示是否启用基于点击的事件处理的标志。\n注意：由于 touchstart/touchend 事件传播与鼠标下移/鼠标上移/单击事件传播不同，因此会出现错误。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "enableKeyboardEvents (default: false)：表示是否启用键盘事件处理的标志。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "delay (default: 0)：延迟处理所有事件的毫秒数，",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "delayTouchStart (default: 0)：延迟处理触摸事件的毫秒数，",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "delayMouseStart (default: 0)：延迟处理鼠标事件的毫秒数。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "touchSlop (default: 0)：指定拖动信号发出前移动的像素距离。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "ignoreContextMenu (default: false)：为 true 时，可防止上下文菜单事件取消拖动。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "scrollAngleRanges: (default: undefined)：指定应忽略拖动事件的角度范围（单位：度）。这在允许用户沿特定方向滚动而不是拖动时非常有用。度数按顺时针方向移动，0/360 指向左侧。",
  "paraId": 3,
  "tocIndex": 3
}, {
  "value": "// allow vertical scrolling\nconst options = {\n  scrollAngleRanges: [\n    { start: 30, end: 150 },\n    { start: 210, end: 330 }\n  ]\n}\n// allow horizontal scrolling\nconst options = {\n  scrollAngleRanges: [{ start: 300 }, { end: 60 }, { start: 120, end: 240 }]\n}\n",
  "paraId": 4,
  "tocIndex": 3
}, {
  "value": "enableHoverOutsideTarget: (default: undefined)：当指针离开 DropTarget 区域时，继续拖动当前拖动的元素。",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": "getDropTargetElementsAtPoint (default: undefined) - 使用 document.elementsFromPoint 或 polyfill：指定一个自定义函数，以便在给定点查找下拉目标元素。在 document.elementsFromPoint 不可用的环境（iOS Safari）中，该函数有助于提高性能。",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": "const hasNative =\n  document && (document.elementsFromPoint || document.msElementsFromPoint)\n\nfunction getDropTargetElementsAtPoint(x, y, dropTargets) {\n  return dropTargets.filter((t) => {\n    const rect = t.getBoundingClientRect()\n    return (\n      x >= rect.left && x <= rect.right && y <= rect.bottom && y >= rect.top\n    )\n  })\n}\n\n// use custom function only if elementsFromPoint is not supported\nconst backendOptions = {\n  getDropTargetElementsAtPoint: !hasNative && getDropTargetElementsAtPoint\n}\n\n;<DndProvider backend={TouchBackend} options={backendOptions}>\n  /* your react application */\n</DndProvider>\n",
  "paraId": 6,
  "tocIndex": 3
}];
