var testingtype_meta_texts = [{
  "value": "React DnD 新手？请在阅读文档之前先阅读",
  "paraId": 0
}, {
  "value": "概述",
  "paraId": 1
}, {
  "value": "。",
  "paraId": 0
}, {
  "value": "React DnD 易于测试。整个拖放交互，包括组件的呈现，以及响应拖放事件的副作用，都可以进行测试。",
  "paraId": 2,
  "tocIndex": 0
}, {
  "value": "测试 React 组件有几种不同的方法。React DnD 并不拘一格，您可以使用其中任何一种方法。",
  "paraId": 3,
  "tocIndex": 0
}, {
  "value": "并非所有方法都要求浏览器事件系统可用。",
  "paraId": 3,
  "tocIndex": 0
}, {
  "value": "React DnD 的 ",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": "examples",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": " 文件夹中包含了一些测试示例。在 ",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": "react-dnd",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": " 根目录中运行 ",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": "yarn install",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": " 和 ",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": "yarn test",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": "，即可启动它们。",
  "paraId": 4,
  "tocIndex": 0
}, {
  "value": "如果您只想孤立地测试组件的渲染，而不想测试它们之间的交互，那么您可以使用用 React DnD 封装的任何类上的 ",
  "paraId": 5,
  "tocIndex": 1
}, {
  "value": "DecoratedComponent",
  "paraId": 5,
  "tocIndex": 1
}, {
  "value": " 静态属性来访问原始类。然后，您就可以使用不同的道具对其进行测试，而无需依赖 React DnD，只需提供一个身份函数来存根连接器方法即可。",
  "paraId": 5,
  "tocIndex": 1
}, {
  "value": "import React from 'react';\nimport TestUtils from 'react-dom/test-utils';\nimport expect from 'expect';\nimport Box from './components/Box';\n\nit('can be tested independently', () => {\n  // Obtain the reference to the component before React DnD wrapping\n  const OriginalBox = Box.DecoratedComponent;\n\n  // Stub the React DnD connector functions with an identity function\n  const identity = (el) => el;\n\n  // Render with one set of props and test\n  let root = TestUtils.renderIntoDocument(\n    <OriginalBox name=\"test\" connectDragSource={identity} />,\n  );\n  let div = TestUtils.findRenderedDOMComponentWithTag(root, 'div');\n  expect(div.props.style.opacity).toEqual(1);\n\n  // Render with another set of props and test\n  root = TestUtils.renderIntoDocument(\n    <OriginalBox name=\"test\" connectDragSource={identity} isDragging />,\n  );\n  div = TestUtils.findRenderedDOMComponentWithTag(root, 'div');\n  expect(div.props.style.opacity).toEqual(0.4);\n});\n",
  "paraId": 6,
  "tocIndex": 1
}, {
  "value": "如果您想测试整个交互，而不仅仅是单个组件的渲染，可以使用",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": "测试后端",
  "paraId": 8,
  "tocIndex": 3
}, {
  "value": "。",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": "测试后端不需要 DOM",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": "，因此也可以与 ",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": "ReactShallowRenderer",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": " 一起使用。",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": "这是目前 React DnD 文档最少的部分，因为它公开了 ",
  "paraId": 9,
  "tocIndex": 3
}, {
  "value": "DnD Core",
  "paraId": 9,
  "tocIndex": 3
}, {
  "value": " 的底层概念，而该库是 React DnD 的核心库。您可以从 ",
  "paraId": 9,
  "tocIndex": 3
}, {
  "value": "DnD Core 测试",
  "paraId": 9,
  "tocIndex": 3
}, {
  "value": "中了解有关测试后端及其方法的更多信息。",
  "paraId": 9,
  "tocIndex": 3
}, {
  "value": "首先，您需要安装测试后端：",
  "paraId": 10,
  "tocIndex": 3
}, {
  "value": "npm install --save-dev react-dnd-test-backend\n",
  "paraId": 11,
  "tocIndex": 3
}, {
  "value": "这里有一些例子供您参考：",
  "paraId": 12,
  "tocIndex": 3
}, {
  "value": "import React from 'react';\nimport { wrapInTestContext } from 'react-dnd-test-utils';\nimport { DragDropContext } from 'react-dnd';\nimport TestUtils from 'react-dom/test-utils';\nimport expect from 'expect';\nimport Box from './components/Box';\n\nit('can be tested with the testing backend', () => {\n  // Render with the test context that uses the test backend\n  const [BoxContext, getBackend] = wrapInTestContext(Box);\n  const root = TestUtils.renderIntoDocument(<BoxContext name=\"test\" />);\n\n  // Test that the opacity is 1\n  let div = TestUtils.findRenderedDOMComponentWithTag(root, 'div');\n  expect(div.props.style.opacity).toEqual(1);\n\n  // Find the drag source ID and use it to simulate the dragging operation\n  const box = TestUtils.findRenderedComponentWithType(root, Box);\n  getBackend().simulateBeginDrag([box.getHandlerId()]);\n\n  // Verify that the div changed its opacity\n  div = TestUtils.findRenderedDOMComponentWithTag(root, 'div');\n  expect(div.style.opacity).toEqual(0.4);\n\n  // See other TestBackend.simulate* methods for more!\n});\n",
  "paraId": 13,
  "tocIndex": 3
}, {
  "value": "您可以在测试库中使用 ",
  "paraId": 14,
  "tocIndex": 4
}, {
  "value": "HTML 5 后端",
  "paraId": 15,
  "tocIndex": 4
}, {
  "value": "或 ",
  "paraId": 14,
  "tocIndex": 4
}, {
  "value": "jsdom",
  "paraId": 14,
  "tocIndex": 4
}, {
  "value": " ",
  "paraId": 14,
  "tocIndex": 4
}, {
  "value": "触摸后端",
  "paraId": 16,
  "tocIndex": 4
}, {
  "value": "测试拖放交互。许多测试库（如 Jest）默认使用 jsdom。",
  "paraId": 14,
  "tocIndex": 4
}, {
  "value": "请注意，jsdom 没有 DragEvent 或 DataTransfer 对象，这将影响拖放和文件拖放测试过程中的预览图像。事件交互也没有与渲染有关的属性，如元素宽度或坐标。",
  "paraId": 17,
  "tocIndex": 4
}, {
  "value": "不过，您可以自行在事件对象属性中添加这些值。",
  "paraId": 18,
  "tocIndex": 4
}, {
  "value": "Enzyme",
  "paraId": 19,
  "tocIndex": 6
}, {
  "value": " 是测试 React 组件的常用工具。由于 ",
  "paraId": 19,
  "tocIndex": 6
}, {
  "value": "Enzyme 中的一个错误",
  "paraId": 19,
  "tocIndex": 6
}, {
  "value": "，您需要在挂载组件时将其封装在一个片段中。然后，您可以存储一个指向被包装组件的 ref，并使用此 ref 访问当前 ",
  "paraId": 19,
  "tocIndex": 6
}, {
  "value": "DragDropMananger",
  "paraId": 19,
  "tocIndex": 6
}, {
  "value": " 实例并调用其方法。",
  "paraId": 19,
  "tocIndex": 6
}, {
  "value": "const [BoxContext] = wrapInTestContext(Box);\n\nconst ref = React.createRef();\nconst root = Enzyme.mount(\n  <>\n    <BoxContext ref={ref} name=\"test\" />\n  </>,\n);\n\n// ...\n\nconst backend = ref.current.getManager().getBackend();\n",
  "paraId": 20,
  "tocIndex": 6
}, {
  "value": "下面是一个使用 HTML5 后端直接测试 DOM 交互的示例：",
  "paraId": 21,
  "tocIndex": 7
}, {
  "value": "render(<Board />);\nlet boardSquares = screen.getAllByRole('gridcell');\nlet dropSquare = boardSquares[0];\nlet knight = boardSquares[18].firstChild;\n\nfireEvent.dragStart(knight);\nfireEvent.dragEnter(dropSquare);\nfireEvent.dragOver(dropSquare);\nfireEvent.drop(dropSquare);\n",
  "paraId": 22,
  "tocIndex": 7
}, {
  "value": "如果需要数据传输属性，也可以",
  "paraId": 23,
  "tocIndex": 7
}, {
  "value": "添加",
  "paraId": 23,
  "tocIndex": 7
}, {
  "value": "这些属性。",
  "paraId": 23,
  "tocIndex": 7
}];
