var faqtype_meta_texts = [{
  "value": "npm install --save react-dnd\nnpm install --save react-dnd-html5-backend\n",
  "paraId": 0,
  "tocIndex": 2
}, {
  "value": "有关示例，请参阅",
  "paraId": 1,
  "tocIndex": 3
}, {
  "value": "测试教程",
  "paraId": 2,
  "tocIndex": 3
}, {
  "value": "。",
  "paraId": 1,
  "tocIndex": 3
}, {
  "value": "指定容器节点作为 dragPreview，但只将拖动句柄设置为 dragSource()。",
  "paraId": 3,
  "tocIndex": 4
}, {
  "value": "默认情况下，您无法限制拖动预览的移动，因为拖动预览是由浏览器绘制的。不过，您可以使用",
  "paraId": 4,
  "tocIndex": 5
}, {
  "value": "自定义拖动图层",
  "paraId": 4,
  "tocIndex": 5
}, {
  "value": "，在该图层中，您可以自由渲染任何内容，也可以使用任何捕捉或限制。",
  "paraId": 4,
  "tocIndex": 5
}, {
  "value": "useDrag 和 useDrop 都可以接受一个类型参数。这可以根据您的道具值进行更改，类似于 useMemo() React 内置钩子的工作方式。",
  "paraId": 5,
  "tocIndex": 6
}, {
  "value": "useDrag 和 useDrop 返回的函数都可以在节点的 ref 函数中连锁使用。例如",
  "paraId": 6,
  "tocIndex": 7
}, {
  "value": "const [, drag] = useDrag(...args);\nconst [, drop] = useDrop(...args);\n\nreturn <div ref={(node) => drag(drop(node))}></div>;\n",
  "paraId": 7,
  "tocIndex": 7
}, {
  "value": "如果使用的是 ",
  "paraId": 8,
  "tocIndex": 8
}, {
  "value": "HTML5 后端",
  "paraId": 9,
  "tocIndex": 8
}, {
  "value": "，则可以为其导出的 NativeType 之一注册下拉目标：",
  "paraId": 8,
  "tocIndex": 8
}, {
  "value": "export const TargetBox = ({ onDrop }) => {\n  const [, drop] = useDrop(\n    () => ({\n      accept: [NativeTypes.FILE],\n      drop(item) {\n        if (onDrop) {\n          onDrop(item);\n        }\n      },\n    }),\n    [onDrop],\n  );\n  return <div ref={drop}>Drop Here</div>;\n};\n",
  "paraId": 10,
  "tocIndex": 8
}, {
  "value": "目前还没有这方面的文档，但您可以从 HTML5 和测试后端实现中得到启发。后端合同包括 setup()和 teardown() 方法，以及 connectDragSource()、connectDragPreview() 和 connectDropTarget() 方法，这些方法可将 DOM 节点传递给后端。欢迎对文档投稿。",
  "paraId": 11,
  "tocIndex": 9
}, {
  "value": "React DnD 需要 React 16.8。请确保您使用的至少是该版本。",
  "paraId": 12,
  "tocIndex": 10
}, {
  "value": "请看这个例子：",
  "paraId": 13,
  "tocIndex": 11
}, {
  "value": "class Page {\n  static willTransitionTo(transition, params) {\n    /* ... */\n  }\n\n  render() {\n    /* ... */\n  }\n}\n\nexport default DragDropContext(HTML5Backend)(Page);\n",
  "paraId": 14,
  "tocIndex": 11
}, {
  "value": "在这种情况下，路由处理程序的 willTransitionTo（或类似方法）不会被触发，这可能会让您大吃一惊！React DnD 不会代理组件的静态方法和属性。这太脆弱且充满边缘情况，因此您必须自己来做。为此，请将您的静态方法放到 React DnD 返回的组件上：",
  "paraId": 15,
  "tocIndex": 11
}, {
  "value": "class Page {\n  render() {\n    /* ... */\n  }\n}\n\nPage = DragDropContext(HTML5Backend)(Page);\nPage.willTransitionTo = function (transition, params) {\n  /* ... */\n};\n\nexport default Page;\n",
  "paraId": 16,
  "tocIndex": 11
}, {
  "value": "虽然只是拖放，",
  "paraId": 17,
  "tocIndex": 13
}, {
  "value": "但我很喜欢",
  "paraId": 17,
  "tocIndex": 13
}, {
  "value": "。",
  "paraId": 17,
  "tocIndex": 13
}, {
  "value": "Stampsy 自 2013 年以来一直在使用该库以及它的非 React 前身。它是 Stampsy 用户体验的核心，因为所有内容都是在使用 React DnD 的拖放式帖子编辑器中创建的。",
  "paraId": 18,
  "tocIndex": 14
}, {
  "value": "React DnD 由 ",
  "paraId": 19,
  "tocIndex": 15
}, {
  "value": "Dan Abramov",
  "paraId": 19,
  "tocIndex": 15
}, {
  "value": " 创建。",
  "paraId": 19,
  "tocIndex": 15
}, {
  "value": "其目的是提供一个功能强大的 API，该 API 与浏览器无关，以数据为中心，可与 React 和 Flux 完美配合，并具有可测试性和可扩展性。请阅读《拖放应用程序接口的未来》（",
  "paraId": 20,
  "tocIndex": 15
}, {
  "value": "The Future of the Drag and Drop API",
  "paraId": 20,
  "tocIndex": 15
}, {
  "value": "）了解一些背景情况。",
  "paraId": 20,
  "tocIndex": 15
}, {
  "value": "它大致基于安德鲁-库兹涅佐夫（",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": "Andrew Kuznetsov",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": "）在 Stampsy 编写的 React 前代码。后来，",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": "Alexander Kuznetsov",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": " 和 ",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": "Nathan Hutchison",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": " 为它做出了宝贵贡献。",
  "paraId": 21,
  "tocIndex": 15
}, {
  "value": "如果没有以下各方的慷慨捐助，React DnD 不可能发布到 1.0 版本：",
  "paraId": 22,
  "tocIndex": 15
}, {
  "value": "Macropod",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "，一家开发团队生产力软件的公司；",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "Webflow",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "，一家开发专业响应式网站构建工具的公司。\n",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "Gadzhi Kharkharov",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": " 设计了网站风格，",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "fixed-data-table",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "项目提供了网站模板。",
  "paraId": 23,
  "tocIndex": 15
}, {
  "value": "为底层的 ",
  "paraId": 24,
  "tocIndex": 16
}, {
  "value": "DnD Core",
  "paraId": 24,
  "tocIndex": 16
}, {
  "value": " 库提供文档将大有帮助，因为它目前根本没有文档，但其概念在一些高级场景（如",
  "paraId": 24,
  "tocIndex": 16
}, {
  "value": "编写测试",
  "paraId": 24,
  "tocIndex": 16
}, {
  "value": "）中会泄露。",
  "paraId": 24,
  "tocIndex": 16
}, {
  "value": "我们也希望能将该库移植到其他现代框架，如 Cycle、Mercury 或 Deku。这样的移植可以重用 DnD Core 逻辑和现有的后端。",
  "paraId": 25,
  "tocIndex": 16
}, {
  "value": "如果您创建了看板应用程序等高级示例，或者撰写了关于 React DnD 的博文或录制了截屏视频，请通过",
  "paraId": 26,
  "tocIndex": 16
}, {
  "value": "问题跟踪器",
  "paraId": 26,
  "tocIndex": 16
}, {
  "value": "告诉我，以便我可以链接到这些示例。",
  "paraId": 26,
  "tocIndex": 16
}, {
  "value": "虽然 DnD Core 已经过全面测试，但 React DnD 目前还没有任何单元测试。编写单元测试是一项伟大而急需的贡献。",
  "paraId": 27,
  "tocIndex": 16
}];
